# part 2

foreach my $aplha (@alphas){

  $polymer2 = $polymer =~ s/$aplha//igr;
  
  $lettersinpolymer = 1;

  while ($lettersinpolymer > 0) {

    $lettersinpolymer = 0;

    foreach my $ltest (@ltests){
      if(index($polymer2, $ltest) > -1){
        $lettersinpolymer++;
      }
      $polymer2 =~ s/$ltest//g;
    }

    if ($lettersinpolymer == 0){
      last;
    }

  }
  

  if(length($polymer2) < $lowerspolynum){
    #say "$aplha: $polymer2 | ".length($polymer2);
    $lowerspolynum = length($polymer2);
  }

}

say "No. units: ". $lowerspolynum;

